import * as tf from "@tensorflow/tfjs";

export const detect = async (net, webcamRef, canvasRef, updateEngagementLevel) => {
    if (
        typeof webcamRef.current !== "undefined" &&
        webcamRef.current !== null &&
        webcamRef.current.video.readyState === 4
    ) {
        const video = webcamRef.current.video;
        const videoWidth = webcamRef.current.video.videoWidth;
        const videoHeight = webcamRef.current.video.videoHeight;

        webcamRef.current.video.width = videoWidth;
        webcamRef.current.video.height = videoHeight;

        canvasRef.current.width = videoWidth;
        canvasRef.current.height = videoHeight;

        const img = tf.browser.fromPixels(video)
        const resized = tf.image.resizeBilinear(img, [120,120])
        const normalized = resized.div(tf.scalar(255.0))
        
        const casted = normalized.cast('float32')
        const expanded = casted.expandDims(0)

        const obj = await net.predict(expanded)

        const isFace = await obj[0].array()
        const isEngaged = await obj[1].array()
        const boxes = await obj[2].array()
        
        const ctx = canvasRef.current.getContext("2d");

        requestAnimationFrame(
            () => {
                drawRect(boxes[0], isFace[0], isEngaged[0], videoWidth, videoHeight, ctx, updateEngagementLevel)
            }); 

        tf.dispose(img)
        tf.dispose(resized)
        tf.dispose(normalized)
        tf.dispose(casted)
        tf.dispose(expanded)
        tf.dispose(obj)
    }
}

export const drawRect = (boxes, isFace, isEngaged, imgWidth, imgHeight, ctx, updateEngagementLevel) => {
    boxes[0] = boxes[0] * imgWidth
    boxes[1] = boxes[1] * imgHeight
    boxes[2] = boxes[2] * imgWidth
    boxes[3] = boxes[3] * imgHeight

    if(isFace[0] > 0.7){
        const [x1, y1, x2, y2] = boxes
        
        if (isEngaged[0] > 0.9) {
            updateEngagementLevel(1)

            ctx.strokeStyle = '#32cd80'
            ctx.lineWidth = 10
            ctx.fillStyle = '#f5f5f5'
            ctx.font = '1.2em Staatliches'         
            
            ctx.beginPath()
            ctx.fillText('Engaged: ' + Math.round(isEngaged[0] * 100) / 100, x1, y1 - 10)
            ctx.rect(x1, y1, (x2 - x1), (y2 - y1));
            ctx.stroke()
        } else {
            updateEngagementLevel(-1)

            ctx.strokeStyle = '#ff4d4d'
            ctx.lineWidth = 10
            ctx.fillStyle = '#f5f5f5'
            ctx.font = '1.2em Staatliches'         
            
            ctx.beginPath()
            ctx.fillText('Not Engaged: ' + Math.round((1 - isEngaged[0]) * 100) / 100, x1, y1 - 10)
            ctx.rect(x1, y1, (x2 - x1), (y2 - y1));
            ctx.stroke()
        }
    } else {
        updateEngagementLevel(-1)
    }
}

// --------------------------------------------------------------- //

export const detectYOLO = async (net, webcamRef, canvasRef, updateEngagementLevel) => {
    if (
        typeof webcamRef.current !== "undefined" &&
        webcamRef.current !== null &&
        webcamRef.current.video.readyState === 4
    ) {
        const video = webcamRef.current.video;
        const videoWidth = webcamRef.current.video.videoWidth;
        const videoHeight = webcamRef.current.video.videoHeight;

        webcamRef.current.video.width = videoWidth;
        webcamRef.current.video.height = videoHeight;

        canvasRef.current.width = videoWidth;
        canvasRef.current.height = videoHeight;

        const img = tf.browser.fromPixels(video)
        const resized = tf.image.resizeBilinear(img, [640,640])
        
        const casted = resized.cast('float32')
        const expanded = casted.expandDims(0)

        const obj = await net.predict(expanded)
        const tensor = await obj.array()
        const result = tensor[0]
        
        const ctx = canvasRef.current.getContext("2d");

        requestAnimationFrame(
            () => {
                drawRectYOLO(result[0], result[1], result[2], result[3], result[4], result[5], videoWidth, videoHeight, ctx, updateEngagementLevel)
            }); 

        tf.dispose(img)
        tf.dispose(resized)
        tf.dispose(casted)
        tf.dispose(expanded)
        tf.dispose(obj)

        tf.dispose(tensor)
        tf.dispose(result)
    }
}

export const drawRectYOLO = (x1, y1, x2, y2, score, class_id, imgWidth, imgHeight, ctx, updateEngagementLevel) => {
    const numBoxes = x1.length
    const boxConfidence = 0.5
    const classConfidence = 0.5
    
    const detections = [];

    // console.log([x1[0], y1[0], x2[0], y2[0], score[0], class_id[0]])

    for (let i = 0; i < numBoxes; i += 1) {
        const currScore = score[i]
        const classScore = class_id[i]

        const gridCellSize = 32;

        const xCenter = x1[0] * gridCellSize;
        const yCenter = y1[0] * gridCellSize;
        const relativeWidth = x2[0] / 640;
        const relativeHeight = y2[0] / 640;

        const width = relativeWidth * imgWidth;
        const height = relativeHeight * imgHeight;
        
        const topLeftX = (xCenter - width / 2).toFixed(2);
        const topLeftY = (yCenter - height / 2).toFixed(2);

        const bottomRightX = (xCenter + width / 2).toFixed(2);
        const bottomRightY = (yCenter + height / 2).toFixed(2);

        if (currScore > boxConfidence) {
            detections.push({
                x1: topLeftX,
                y1: topLeftY,
                x2: bottomRightX,
                y2: bottomRightY,
                confidence: currScore,
                class: classScore,
            })
        }
    }

    // const nmsDetections = NMS(points);
    console.log(detections)
    // console.log("---------------")

    detections.forEach((box) => {        
        if (box.class > classConfidence) {
            ctx.strokeStyle = '#32cd80'
            ctx.lineWidth = 10
            ctx.fillStyle = '#f5f5f5'
            ctx.font = '1.2em Staatliches'         
            
            ctx.beginPath()
            ctx.fillText(box.class, box.x1, box.y1 - 10)
            ctx.rect(box.x1, box.y1, box.x2, box.y2);
            ctx.stroke()
        } 
        else {
            ctx.strokeStyle = '#ff4d4d'
            ctx.lineWidth = 10
            ctx.fillStyle = '#f5f5f5'
            ctx.font = '1.2em Staatliches'        
            
            ctx.beginPath()
            ctx.fillText(box.class, box.x1, box.y1 - 10)
            ctx.rect(box.x1, box.y1, box.x2, box.y2);
            ctx.stroke()
        }
    })
}
